            //     <TouchableOpacity onPress={this.props.deleteMethod} style={styles.noteDelete}>
            //         <Text style={styles.noteDeleteText}>D</Text>
            //     </TouchableOpacity>

            // </View>
            <div>
                <LoadHome/>
            </div>



        );
    }

};
